import styles from '../../src/App.module.scss';
import React, { Component } from "react";

class Explore extends Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (
            <div>
                <h1 className={styles.Header}>Explore page</h1>
            </div>
        )
    }
}

export default Explore;
